import {makeStyles} from '@mui/material/styles/makeStyles'
export default makeStyles(()=>({
    appBar:{
        borderRadius:15,
        margin: '30px 0',
        display:'flex',
        flexDirection:'row',
        justifyContent:'center',
        alignItems:'center',
    },
    heading:{
        color:'rgba(0,183,255,1)',
    },
    images:{
        marginLeft:'15px',
    },
    }
));
